import React, { Component } from 'react'

export default class Login extends Component {
    render() {
        return (
            <div>
                <div>
                    <h3>Login</h3>
                    <form action="">
                        <input type="email" name='email' placeholder='email...' required />
                        <input type="password" name= 'pwd' placeholder='password' required />
                        <button></button>
                    </form>
                </div>

            </div>
        )
    }
}
